import React from 'react';
import './Body.css';
import FileUploder from './fileupload';

function Body({ handleUploadFile }) {

    return (
        <>
            <div className='body'>
                <FileUploder handleUploadFile={handleUploadFile(event)} />
            </div>
        </>
    )
}

export default Body;
